import React, { Component } from 'react';
import "./Stopwatch.css"

class Stopwatch extends Component {
  render() {
    return (
      <div className="stopwatch">
        <h1>0:00</h1>
        <div className="controls">
          <button>Reset</button>
          <button>Start</button>
          <button>Pause</button>
        </div>
      </div>
    );
  }
}

export default Stopwatch;
